import React from'react';
import Posts from './Posts'
import Create from './Create';
import { Route, Switch } from 'react-router-dom';

function Body() {
  return (
    <Switch>
      <Route exact path="/" component={Posts}/>
      <Route exact path="/create" component={Create}/>
    </Switch>
  );
}

export default Body;
